import React from 'react';

import './form-input.scss';

const FormInput = () => (
    <form>
        <input name="email"
            type="email"
            value={this.state.email}
            onSubmit={this.handleSubmit}
            onChange={this.handleChange}
            required />
        <label >Email</label>
        <input name="password"
            type="password"
            value={this.state.password}
            onSubmit={this.handleSubmit}
            onChange={this.handleChange}
            required />
        <label >Password</label>
        <input type="submit" value="submit" />
    </form>
)
